/**
 * 页面查询
 * @param beginTime  统计日期开始
 * @param endTime    统计日期结束
 * @param name       卡片名称或者卡号
 */
function find(beginTime, endTime, name) {
    if (beginTime == '') {
        beginTime = '--';
    }
    if (endTime == '') {
        endTime = '--';
    }
    var sql = !!name ? "select  card.quota,card.id,card.name,card.code,card.quota, card.createtime time,(case when (detall.createtime IS NOT NULL) then max(detall.createtime) else '--' end) time2,(case when (detall.amount IS NOT NULL)  then sum(detall.amount)  else 0 end) amount,(case when (detall.num IS NOT NULL) then sum(detall.num) else 0 end) num,detall.cardcode from CARD card LEFT JOIN DETAIL detall ON card.code=detall.cardcode where 1=1 and card.name like ? or card.code like ?  group by card.code " : "select card.quota,card.id,card.name,card.code, card.createtime time,(case when (detall.createtime IS NOT NULL) then max(detall.createtime) else '--' end) time2,(case when (detall.amount IS NOT NULL)  then sum(detall.amount)  else 0 end) amount,(case when (detall.num IS NOT NULL) then sum(detall.num) else 0 end) num,detall.cardcode from CARD card LEFT JOIN DETAIL detall ON card.code=detall.cardcode where 1=1   group by card.code ";
    top.db.transaction(function (tx) {
        tx.executeSql(sql, !!name ? [name, name] : [], function (tx, result) {
            var msg = ''
            for (var i = 0; i < result.rows.length; i++) {
                var code = (result.rows[i].code).toString()
                msg += '<tr><td>' + result.rows[i].name + '</td><td>' + beginTime + '</td><td>' + endTime + '</td><td>' + format(result.rows[i].time2) + '</td><td>' + toDecimal(result.rows[i].amount) + '</td><td>' + result.rows[i].num + '</td><td>' + toDecimal(result.rows[i].quota) + '</td>'
                msg += '<td><div style="cursor: pointer;" class="ax_default link_button" onclick="openpanle(\'' + code + '\')">'
                msg += '   <div  class="text ">'
                msg += '   <p><span>查看明细</span></p>'
                msg += '   </div>'
                msg += '   </div></td></tr>';
            }
            document.getElementById("tbody").innerHTML = msg;

        }, function (tx) {
            console.log(tx);
        });
    });
}

