/**
 * 时间戳转日期
 * @param datenum 传入时间戳
 */
function format(datenum) {
    if (datenum == '--') {
        return datenum;
    }
//shijianchuo是整数，否则要parseInt转换
    var nums = parseInt(datenum);
    var time = new Date(nums);
    var y = time.getFullYear();
    var m = time.getMonth() + 1;
    var d = time.getDate();
    var h = time.getHours();
    var mm = time.getMinutes();
    var s = time.getSeconds();
    return y + '-' + add(m) + '-' + add(d) + ' ' + add(h) + ':' + add(mm) + ':' + add(s);
}

function add(m) {
    return m < 10 ? '0' + m : m
}

//强制保留两位小数
function toDecimal(x) {
    var f = parseFloat(x);
    if (isNaN(f)) {
        return false;
    }
    var f = Math.round(x * 100) / 100;
    var s = f.toString();
    var rs = s.indexOf('.');
    if (rs < 0) {
        rs = s.length;
        s += '.';
    }
    while (s.length <= rs + 2) {
        s += '0';
    }
    return s;
}

